window.bookSummaryJSON = "Jane Austen's classic romantic comedy is the sparkling tale of the Bennets, a family blessed with five daughters and a mother desperate to marry them off. The tempestuous pairing of the witty, independent Elizabeth and her arrogant but honorable suitor Mr. Darcy sets the standard for all great couples of stage and screen. Although many have tried, few literary romances have matched the wit and gentile satire of Austen's <i>Pride and Prejudice</i>."; 
